import {Link} from 'react-router-dom'

export default function Header(){
  
    return(
     <ul>
         <li><Link to="/">Home</Link></li>
         <li><Link to="about">About</Link></li>
         <li><Link to="contact">Contact</Link></li>
         <li><Link to="create">Product Create</Link></li>
     </ul>
        
    );
}
